<template>
  <div id="cont">
    <div id="login">
      <p>哆唻聊天室</p>
      <div id="inp">
        <p>昵称:</p>
        <input type="text" v-model="uname"/>
      </div>
      <!--头像-->
      <div id="avatar">
        <img class="avatar" v-for="(i, index) in srcS" alt="头像加载失败!请刷新页面!" :src="i" @click="chooseAvatar(index)">
      </div>
      <div id="btn" v-show="showButton">
        <div>
          <button @click="login">进入聊天室</button>
        </div>
      </div>
    </div>
  </div>
</template>

<script lang="ts">
import {defineComponent, ref, Ref, watch} from "vue";
import store from "../store";
import router from "../router";

export default defineComponent({
  name: "login",
  setup: function () {
    //是否显示按钮
    let showButton: Ref<boolean> = ref(false);
    //用户名
    let uname: Ref<string> = ref("");
    let avatar: Ref<number | undefined> = ref(undefined)
    //头像数据
    let srcS: Array<string> = [
      "data:image/jpeg;base64,",
      "data:image/jpeg;base64,",
      "data:image/jpeg;base64,",
      "data:image/jpeg;base64,",
      "data:image/jpeg;base64,",
      "data:image/jpeg;base64,",
      "data:image/jpeg;base64,",
      "data:image/jpeg;base64,",
      "data:image/jpeg;base64,",
      "data:image/jpeg;base64,",
      "data:image/jpeg;base64,",
      "data:image/jpeg;base64,"
    ];
    store.state.srcS = srcS;
    //登录
    const login = (): void => {
      if (uname.value === "" || avatar.value === undefined) {
        alert("请选择头像后在进入聊天室!");
        return;
      }
      store.state.uname = uname.value;
      store.state.avatar = avatar.value;
      router.push("/home");
    }
    //监听
    watch(
        () => uname.value,
        () => {
          showButton.value = uname.value !== "";
        },
        {deep: true, immediate: true}
    )
    //头像选择器
    const chooseAvatar = (index: number) => {
      avatar.value = index;
      //找到对应头像的html
      let nowAvatar: HTMLCollectionOf<Element> = document.getElementsByClassName("avatar");
      //修改该元素的css样式
      for (let i = 0; i < nowAvatar.length; i++) {
        nowAvatar[i].id = "";
      }
      nowAvatar[index].id = "nowAvatar";
    }
    //监听键盘回车事件
    document.onkeydown = (e) => {
      if(uname.value !== "") {
        if (e.key === "Enter") {
          login();
        }
      }
    }
    return {
      store, uname, srcS, showButton, login, avatar, chooseAvatar
    }
  }
});
</script>

